import React from 'react';
import { NavLink } from 'react-router-dom';
import './navigation.css';

const Navigation = () => {
  return (
    <nav className="navbar">
      <ul className="nav-links">
        <li>
          <NavLink 
            to="/" 
            className={({ isActive }) => (isActive ? "active-link" : "nav-link")}
          >
            Home
          </NavLink>
        </li>
        <li>
          <NavLink 
            to="/entry-exit" 
            className={({ isActive }) => (isActive ? "active-link" : "nav-link")}
          >
            Entry/Exit
          </NavLink>
        </li>
        <li>
          <NavLink to="/profiles" className={({ isActive }) => (isActive ? "active-link" : "nav-link")}>Profile</NavLink>
        </li>
        <li>
          <NavLink 
            to="/logout" 
            className={({ isActive }) => (isActive ? "active-link" : "nav-link")}
          >
            Log Out
          </NavLink>
        </li>
      </ul>
    </nav>
  );
};

export default Navigation;
